import React from 'react';
import '../../App.css';
import '../Apropos.css';

export default function Apropos() {
  return (
    <div className="apropos-container">
      <div className="apropos-image">
        <img src="images/chambre.jpg" alt="Ravi de vous accueillir" />
        <div className="apropos-text">
          <h2>Ravi de vous accueillir</h2>
          <p>Vous trouverez ci-dessous les informations nécessaires à propos de nous.</p>
        </div>
      </div>
      <div className="apropos-info">
        <h3>Informations sur l'hôtel</h3>
        <p>Adresse : 123 Rue de l'Hôtel, Ville</p>
        <p>Téléphone : +123 456 789</p>
        <p>Email : contact@hotel.com</p>
        {/* Ajoutez d'autres informations ici */}
      </div>
    </div>
  );
}
